  \"2016-07-27T23:01:44.485555\",\n\t\"name\": \"the-status-of-peregrine-falcons-and-other-raptors-along-the-porcupine-river-alaska-1981-fi\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"In 1979, the U.S. Fish and Wildlife Service
  initiated a banding project on the Yukon, Porcupine, and Colville rivers where high
  concentrations of peregrines are located. This report provides the results of the
  1981 banding project on the Porcupine River. The objectives of this study were:
  1. To locate cliffs occupied by peregrine falcons on the Porcupine River, determine
  productivity, and band nestlings; 2. To collect prey items, addled eggs, and eggshell
  fragments from active peregrine nests; and 3. To locate other raptors, raptor nests,
  and band as many nestlings as possible. Submitted to U.S. Fish & Wildlife Service,
  Endangered Species Office, contract no. 14-16-0007-81-5208.\",\n\t\"license_title\":
